('1055047500153050', 'system_update_notification_any_platform', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"TEXT\",\"text\":\"System Downtime Alert \\u2013 {{1}}\",\"example\":{\"header_text\":[\"Date & Time\"]}},{\"type\":\"BODY\",\"text\":\"Hi {{1}},\\n\\nPlease be informed that there will be a scheduled system update for {{2}} on {{3}} from {{4}} to {{5}}. \\n\\nDuring this period, access to the platform may be temporarily disrupted. Please plan your work accordingly. \\n\\nWe appreciate your understanding and apologise for any inconvenience caused.\\n\\n**This is an automated message. Please do not reply.*\",\"example\":{\"body_text\":[[\"Learner Name\",\"SystemName: Portal\",\"Date\",\"Start Time\",\"End Time\"]]}},{\"type\":\"FOOTER\",\"text\":\"Learning Management\"}]', 'en'),
('1227568895836697', 'attendance__learner_missed_multiple_sessions', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"TEXT\",\"text\":\"Reminder: Attend Upcoming Sessions\"},{\"type\":\"BODY\",\"text\":\"Hi {{1}}, \\n\\nYou have missed multiple sessions for your course, and we haven\\u2019t\\nreceived any updates from you despite our earlier emails.\\n\\nKindly note that this may affect your attendance records and training allowance eligibility.\\nThis is a reminder to attend upcoming classes to stay on track.\\n\\n**This is an automated message. Please do not reply.*\",\"example\":{\"body_text\":[[\"learner name\"]]}},{\"type\":\"FOOTER\",\"text\":\"Learning Management\"}]', 'en'),
